import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";

const Footer = () => {
  return (
    <Navbar className="bg-body-tertiary">
      <Container>
        <Navbar.Brand href="#home">
          <img
            alt=""
            src="/img/wink.png"
            width="30"
            height="30"
            className="d-inline-block align-top"
          />{" "}
          그림일기장
        </Navbar.Brand>
      </Container>
    </Navbar>
  );
};
export default Footer;
